              <img src={fb} alt="fb" />
            </button>
          </a>
          <a href='https://www.linkedin.com/in/france-samaniego-0a2011227/'> 
            <button className="socmed" type='submit'>
              <img src={linkedin} alt="linkedin" />
            </button>
          </a>
        </div>
        <h3>Designed and Built by France Samaniego</h3>
      </div>
    </footer>
  )
}

export default Footer
